import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <div className="nav">

            <li className="list-item">Home</li>
            <li className="list-item">About</li>
            <li className="list-item">Contate</li>


        </div>
      </header>
    </div>
  );
}

export default App;
